using System;
using System.Collections.Generic;
using System.Data.Entity;
using System.Web.Http;
using HulloVMailManager.Models;
using Microsoft.WindowsAzure.Mobile.Service;
using AutoMapper;
using HulloVMailManager.DataObjects;

namespace HulloVMailManager
{
    public static class WebApiConfig
    {
        public static void Register(HttpConfiguration configuration)
        {
            // Use this class to set configuration options for your mobile service
            ConfigOptions options = new ConfigOptions();

            // Use this class to set WebAPI configuration options
            HttpConfiguration config = ServiceConfig.Initialize(new ConfigBuilder(options));

            // To display errors in the browser during development, uncomment the following
            // line. Comment it out again when you deploy your service for production use.
            config.IncludeErrorDetailPolicy = IncludeErrorDetailPolicy.Always;

            configuration.Routes.MapHttpRoute(name: "DefaultApi", routeTemplate: "api/{controller}/{id}", defaults: new {id = RouteParameter.Optional});

            Database.SetInitializer(new hullovmailInitializer());

            Mapper.Initialize(cfg =>
            {
                cfg.CreateMap<VoicemailDTO, Voicemail>();
                cfg.CreateMap<Voicemail, VoicemailDTO>();
            });
        }

        public static byte[] GetBytes(string str)
        {
            byte[] bytes = new byte[str.Length*sizeof (char)];
            System.Buffer.BlockCopy(str.ToCharArray(), 0, bytes, 0, bytes.Length);
            return bytes;
        }
    }

