                new Voicemail { VoicemailID = 1, From = "John Holmes", RecordedDate = Convert.ToDateTime("01-Jul-2014"), Message = msg1, IsNew = false, EmailID = "EmailId1", FromDisplay = "John Holmes Display"},
                new Voicemail { VoicemailID = 2, From = "Sunrise Adams", RecordedDate = Convert.ToDateTime("12-May-2014"), Message = msg2, IsNew = false, EmailID = "EmailId2", FromDisplay = "Sunrise Adams Display"},
